import React from 'react';
import logo from './logo.svg';
import './App.css';
import Titular from './Titular.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
         HOLA
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          <Titular />
        </a>
      </header>
    </div>
  );
}


export default App;
